      <EntryLine description='Something Else' value='$100.00' color='green'/>
      <EntryLine description='Something' value='$20.00' color='red'/>


     <MainHeader title='Add New Transaction' type='h3'/>

        <NewEntryForm />
      </Container>

  );
}

